package cn.sx.decentworld.bean;

import com.activeandroid.Model;
import com.activeandroid.annotation.Column;
import com.activeandroid.annotation.Table;

/**
 * @ClassName: IPBean.java
 * @Description: 
 * @author: cj
 * @date: 2015年10月16日 上午10:19:08
 */
@Table(name = "ipBean")
public class IPBean extends Model
{
	@Column(name = "one")
	String one;
	
	
	@Column(name = "two")
	String two;
	
	@Column(name = "three")
	String three;
	
	@Column(name = "four")
	String four;
	
	@Column(name = "ip")
	String ip;
	
	/**
	 * 
	 */
	public IPBean()
	{
		// TODO Auto-generated constructor stub
	}



	/**
	 * @param one
	 * @param two
	 * @param three
	 * @param four
	 * @param ip
	 */
	public IPBean(String one, String two, String three, String four, String ip)
	{
		super();
		this.one = one;
		this.two = two;
		this.three = three;
		this.four = four;
		this.ip = ip;
	}



	/**
	 * @return the one
	 */
	public String getOne()
	{
		return one;
	}

	/**
	 * @param one the one to set
	 */
	public void setOne(String one)
	{
		this.one = one;
	}

	/**
	 * @return the two
	 */
	public String getTwo()
	{
		return two;
	}

	/**
	 * @param two the two to set
	 */
	public void setTwo(String two)
	{
		this.two = two;
	}

	/**
	 * @return the three
	 */
	public String getThree()
	{
		return three;
	}

	/**
	 * @param three the three to set
	 */
	public void setThree(String three)
	{
		this.three = three;
	}

	/**
	 * @return the four
	 */
	public String getFour()
	{
		return four;
	}

	/**
	 * @param four the four to set
	 */
	public void setFour(String four)
	{
		this.four = four;
	}



	/**
	 * @return the ip
	 */
	public String getIp()
	{
		return ip;
	}



	/**
	 * @param ip the ip to set
	 */
	public void setIp(String ip)
	{
		this.ip = ip;
	}
	
	
	
}
